window.bookSummaryJSON = "<p><b>The Noobtown saga continues with&nbsp;</b><b><i>Noob Game Plus</i></b><b>, the eagerly awaited sequel to top Audible-ranked&nbsp;</b><b><i>Dungeons and Noobs</i></b><b>, from a LitRPG author at the top of his game. Join the millions of listeners who have enjoyed Johnathan McClain’s hilarious portrayal of Jim; his shoulder demon, Shart; his animal companion, Badgelor; and so many other unforgettable characters.</b>&nbsp;</p> <p><i>What happened? </i></p> <p>The last thing Jim remembered was being tossed unceremoniously through the Demon Door. Now, he's right back where he first started his adventure, sans demon and badger. Jim’s got to make some fast choices if he has any hope of making it back to Windfall and defeating Charles. But after Jarra's death, is Windfall even what he wants anymore?</p>"; 
